import { useState } from "react"

const TodoAdd = () => {
  const [name,setName] = useState('')
  const onKeyUp = e=>{
    e.keyCode===13&&console.log('需要添加任务');
  }
  return (
    <header className="header">
      <h1>todos</h1>
      <input
        className="new-todo"
        placeholder="What needs to be done?"
        autoFocus
        value={name}
        onChange={e=>setName(e.target.value)}
        onKeyUp={onKeyUp}
      />
    </header>
  )
}

export default TodoAdd
